import { configureStore } from "@reduxjs/toolkit";
import authReducer from "../features/authSlice";
import mainReducer from "../features/mainSlice";
import metaReducer from "../features/metaSlice";

export default configureStore({
  reducer: {
    auth: authReducer,
    main: mainReducer,
    meta: metaReducer,
  },
});
